import React from 'react'

const FormPage = () => {
  return (
    <div>      
    <HeaderStudent />
    <div className="main-div">
      <div className="Fill-Forms-box">
        {isForm2Existing()}
      </div>
    <GuideNav />
    </div>
    <WebsiteFooter />
    </div>
  )
}

export default FormPage
